import React from "react";
import '../css/simpleNav.css';
import dreamHouse1 from '../images/dreamHouse1.png';

function SimpleNav(){
    return(
        <>
            <div className="nav-body">
                <div className="simple-nav-logo">
                    <img src={dreamHouse1} alt="" />
                </div>
            </div>
        </>
    );
}

export default SimpleNav;
